import React from 'react';

const Sidebar = () => {
  const dyscypliny = ['Football', 'Basketball', 'Tennis'];

  return (
    <aside className="left-panel" style={{ height: '100vh', overflowY: 'auto' }}>
      {dyscypliny.length > 0 ? (
        dyscypliny.map((d, i) => (
          <button key={i} className="btn btn-lg btn-custom link_but_button w-100 mb-2">
            {d}
          </button>
        ))
      ) : (
        <p className="text-muted px-2">Brak dostÄ™pnych dyscyplin.</p>
      )}
    </aside>
  );
};

export default Sidebar;
